description:
Comme le précise la circulaire du 16 janvier 2020 sur le déroulement des opérations électorales, dès l'ouverture de la campagne électorale officielle, les communes doivent installer des panneaux électoraux aux abords des bureaux de vote.
Le nombre maximum de ces emplacements est fixé en fonction du nombre d'électeurs des communes :
    - cinq emplacements dans les communes de moins de 500 électeurs ;
    - dix emplacements dans les communes ayant entre 501 et 5 000 électeurs ;
    - dix emplacements et plus pour les plus grandes communes (en proportion du nombre d'électeurs).

Cette couche représente le contour de la ZTL sur Rennes. Dans la ZTL de Rennes :  
\- La vitesse reste limitée à 20 km/h, (comme depuis juin 2020) ;  
\- Priorité est donnée aux piétons et aux vélos ;  
\- Tous les conducteurs de véhicules motorisés ne peuvent pas y entrer.  
Sont autorisés avec justificatif (suivant l'arrêté) :   
\- Les riverains (habitants, professionnels) ;  
\- Les artisans en intervention ;   
\- Les livreurs ;  
\- Les personnels médicaux et aides à la personne ;  
\- Les clients des hôtels ;   
\- Les patients qui ont un rendez-vous médical dans la zone ;   
\- Les personnes transportant un achat encombrant ;   
\- Les accompagnateurs de riverains dans l'incapacité de conduire ;   
\- Les personnes à mobilité réduite…  
Sont autorisés sans justificatif :   
\- Les services de police et de sécurité ;   
\- Les taxis ;  
\- Les véhicules de secours ;  
\- Les exploitants de réseaux en intervention ;  
\- Les véhicules de services municipaux en intervention ;  
\- Les cycles et trottinettes ;   
\- Les transports de fonds ;   
\- Les transports en commun ;   
\- Les cortèges et véhicules officiels ;   
\- Les véhicules d’auto-partage.  
Sur le terrain, une signalisation indique les points d'entrée de la ZTL.

Les données mises à disposition sont les informations extraites du système d’information « Prix Carburants ». Ces données concernent les points de ventes ouverts référencés sur le site https://www.prix-carburants.gouv.fr ([Arrêté ministériel du 12 décembre 2006](https://www.legifrance.gouv.fr/jorf/id/JORFTEXT000000817439)).
Les données disponibles comprennent :
  * Les informations générales sur le point de vente : adresse, coordonnées géographiques, horaires d’ouverture et services proposés ;
  * Les prix et les informations figurant dans le système d’information;
  * Les ruptures de stock de carburants ;
  * Les fermetures définitives ou temporaires des points de vente.
Le flux de données quotidien contient les données à la date J-1**( veille du jour en cours)**.
**Dans le cas où vous constatez une différence entre les informations sur place vs ce jeu de données, nous vous invitons à les signaler sur le[site gouvernemental informatif dédié au prix des carburants via la rubrique contact](https://www.prix-carburants.gouv.fr/contact/).** Chaque direction administrative compétente recevra le signalement et pourra demander la mise à jour des informations.
