Sous l'autorité du préfet, les infrastructures de transports terrestres sont recensées et classées en 5 catégories, en fonction de leurs caractéristiques sonores et du trafic.
Sur la base de ce classement, le préfet détermine ensuite par arrêté :
1° Les secteurs affectés par le bruit situés au voisinage des infrastructures recensées ;
2° Les niveaux sonores que les constructeurs sont tenus de prendre en compte pour la construction des bâtiments inclus dans ces secteurs ;
3° Les isolements acoustiques de façade requis en application de l'arrêté prévu à l'article R. 571-43 du Code de l'environnement.
Le recensement et le classement des infrastructures de transports terrestres portent sur les voies routières dont le trafic journalier moyen annuel existant, ou prévu dans l'étude ou la notice d'impact du projet d'infrastructure, est supérieur à 5000 véhicules par jour.

