Les routes à grande circulation définies à l'article L. 110-3 du code de la route sont :
a) Les routes nationales définies à l'article L. 123-1 du code de la voirie routière et mentionnées par le décret du 5 décembre 2005 susvisé ;
b) Les routes dont la liste est annexée au décret en vigueur c) Les bretelles reliant entre elles soit deux sections de routes à grande circulation, soit une section de route à grande circulation et une autoroute. On entend par « bretelle » une voie assurant la liaison entre deux routes qui se croisent à des niveaux différents.

